function App() {
  const expenses = [
    { title: "Car insurence", amount: 265.2, date: new Date(2023, 3, 2) },
  ];

  return (
    <div>
      <h2>Let's get started!!!</h2>
      <p>This is also visible!</p>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
